import React, { Component } from 'react';
//import logo from './logo.svg';
import './App.css';
import './Style.scss';

class App extends Component {
  render() {
    return (
      <div className="App">
      <header className='super'>

        <div className='container'>
          <div className='inner-box'>   </div>
        </div>

        <div className='container'>
          <div className='inner-box'> </div>
        </div>

        <div className='container'>
          <div className='inner-box'> </div>
        </div>

        <div className='container'>
          <div className='inner-box'> </div>
        </div>

      </header>
      <Button>Close</Button>
      </div>
    );
  }
}

export default App;
